import React from "react";

const barStyles = {

  height: "100%", /* 100% Full-height */
  width: "10%", /* 0 width - change this with JavaScript */
  position: "fixed", /* Stay in place */
  zIndex: "1", /* Stay on top */
  top: "0", /* Stay at the top */
  left: "0",
  backgroundColor: "#9b2e90", /* purple*/
  overflowX: "hidden", /* Disable horizontal scroll */
  paddingTop: "10%", /* Place content 10% from the top */
  paddingBottom: "10%" /*Place content 10% from bottom */
}

function Todo(){
    return(
        <div style = {barStyles}>
            <h1>this</h1>
            <h1>this</h1>
            <h1>this</h1>
            <h1>this</h1>
        </div>
    );
}

export default Todo;
